export const getBlogLists = categoryName => {
  const URL = "http://localhost:9000/blogs/";
  const category = categoryName || "";

  return dispatch => {
    fetch("http://localhost:9000/blogs/life")
      .then(res => res.json())
      .then(blogs => {
        dispatch({
          type: "BLOG_LISTS",
          // blogs: result.data
          blogs
        });
      })
      .catch(error => {
        dispatch({
          type: "FETCH_ERROR",
          error
        });
      });
  };
};
